var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 40923205 \n 網站倉儲:  https://github.com/40923205/cad2021_hw \n 網站連結:\xa0 https://40923205.github.io/cad2021_hw/ \n 其他與作者或作業相關資料說明或介紹 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Task', 'text': '', 'tags': '', 'url': 'Task.html'}, {'title': 'hwpages', 'text': 'cad2b w2 github account \n 40723126 \xa0 \xa0 \xa0 40823146 \xa0 \xa0 \xa0 40923208 \xa0 \xa0 \xa0 40923219 \xa0 \xa0 \xa0 40923230 \xa0 \xa0 \xa0 40923240 \xa0 \xa0 \xa0 40923250 \n 40723135 \xa0 \xa0 \xa0 40823148 \xa0 \xa0 \xa0 40923209 \xa0 \xa0 \xa0 40923220 \xa0 \xa0 \xa0 40923231 \xa0 \xa0 \xa0\xa0 40923241 \xa0 \xa0 \xa0 40923251 \xa0 \n 40723217 \xa0 \xa0 \xa0 40823215 \xa0 \xa0 \xa0 40923210 \xa0 \xa0 \xa0 40923221 \xa0 \xa0 \xa0 40923232 \xa0 \xa0 \xa0 40923242 \xa0 \xa0 \xa0 40923252 \n 40732331 \xa0 \xa0 \xa0 40871106 \xa0 \xa0 \xa0\xa0 40923211 \xa0 \xa0 \xa0\xa0 40923223 \xa0 \xa0 \xa0 40923233 \xa0 \xa0 \xa0 40923243 \xa0 \xa0 \xa0 40923253 \n 40823114 \xa0 \xa0 \xa0 40923201 \xa0 \xa0 \xa0\xa0 40923212 \xa0 \xa0 \xa0 40923224 \xa0 \xa0 \xa0 40923234 \xa0 \xa0 \xa0 40923244 \xa0 \xa0 \xa0 40971220 \n 40823115 \xa0 \xa0 \xa0 40923203 \xa0 \xa0 \xa0\xa0 40923213 \xa0 \xa0 \xa0 40923225 \xa0 \xa0 \xa0 40923235 \xa0 \xa0 \xa0 40923245 \xa0 \xa0 \xa0 40971227 \n 40823117 \xa0 \xa0 \xa0 40923204 \xa0 \xa0 \xa0 \xa0 40923214 \xa0 \xa0 \xa0 40923226 \xa0 \xa0 \xa0 40923236 \xa0 \xa0 \xa0 40923246 \xa0 \xa0 \xa0 \n 40823119 \xa0 \xa0 \xa0 40923205 \xa0 \xa0 \xa0\xa0 40923216 \xa0 \xa0 \xa0 40923227 \xa0 \xa0 \xa0 40923237 \xa0 \xa0 \xa0 40923247 \xa0 \xa0 \xa0 \n 40823122 \xa0 \xa0 \xa0 40923206 \xa0 \xa0 \xa0\xa0 40923217 \xa0 \xa0 \xa0 40923228 \xa0 \xa0 \xa0 40923238 \xa0 \xa0 \xa0 40923248 \xa0 \xa0\xa0 \n 40823127 \xa0 \xa0 \xa0 40923207 \xa0 \xa0 \xa0\xa0 40923218 \xa0 \xa0 \xa0 40923229 \xa0 \xa0 \xa0 40923239 \xa0 \xa0 \xa0 40923249 \xa0 \xa0 \xa0 \n \n', 'tags': '', 'url': 'hwpages.html'}, {'title': 'Wink', 'text': '1.搜尋 debugmode Wink 並點選 Download Wink 3.0 for Windows 下載 \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 2.開始錄影前的操作 開啟 Wink ， 點選 File 裡的 Preferences \n \n \n 使 wink 連至 shareX / tool / ffmpeg.exe \n \n \n 點選 File 的 New 創一個新的錄影畫面 \n \n \n \n \n \n 3.Wink 右鍵 \n \xa0 (1)開始錄製點選 Start Timed Capture \n \xa0 (2)錄製結束後點選 Finish Capture \n \n \n 調整Wink畫面大小(Full size要為偶數之後才能輸出影片) \n \n \n \n \n', 'tags': '', 'url': 'Wink.html'}, {'title': 'HW1', 'text': 'HW1 佔學期成績 25% \n HW1 必須在 2021.11.10 22:00 之前完成. \n HW1 具體項目成果回報區 將於 2021.09.23 開啟, 於  2021.11.10 22:00 關閉. \n 作業一: meArm Robot 零件繪圖與機電運動模擬場景製作 \n Step1 : 下載  meARM.7z  這個包含尚未完成組立的 meArm Robot 場景與雷射切割零件組立手冊. \n meArm_75-0040_v1.pdf  則是另外一本組立參考手冊. \n Step2 : 從課程網頁中的  Compile CoppeliaSim 頁面 , 下載  coppeliaSim 4.1.0 官方版與 MSYS2 編譯版.7z  (檔案大小 412 MB, 解開壓縮後 1GB) 可攜套件. \n Step3 : 在 HW1 中, 要求每一位學員透過程式亂數分配 (兩班實際亂數分配結果以上課時點擊下列按鈕所得結果為準) 所使用的兩套參數式 CAD 套件, 從軟體發展緣起開始進行介紹,\xa0 經過教育版軟體套件檔案的取得, 下載安裝以及配置使用. 根據 Step1 中的零件尺寸, 逐一完成 meArm Robot 各零件繪製與組立. 並將零件 匯入  CoppeliaSim 進行組裝配置後, 以  UI 介面 中的 slider 控制 meArm Robot 各軸的旋轉作動. \n 2b CAD 套件分配結果:  https://mde.tw/cad2021/downloads/online/2b_hw1_cad.txt \n 附件: \n 1. CAD 套件分配表: \n sw: Solidworks, inv: Inventor, nx: NX12, ons: Onshape, slvs: Solvespace \n 2a 套件亂數分配結果 \n 2b 套件亂數分配結果 \n 2. 在兩套 CAD 完成零件繪圖並轉入 CoppeliaSim 後, 為了建立 Dynamic Model 必須利用  shape edit modes  轉為  clean model , 並與實際轉入的 STL 格式零件外形結合應用後建立模擬場景 (scenes). \n 3. meARM Robot  動態模擬場景 的建構, 可參考  0 ,  1 ,  2 ,  3 ,  4 ,  5 ,  6 ,  7 , 也可參考  Uarm Robot model  與相關 影片 . \n 4. CoppeliaSim design dynamic simulations  說明頁面 . \n 5.  網際 Lua  程式執行. \n 6.  meArm.slvs ,  meArm_in_solvespace.slvs \n 7. UI 介面程式參考: \n function closeEventHandler(h)\n    sim.addLog(sim.verbosity_scriptinfos,\'Window \'..h..\' is closing...\')\n    simUI.hide(h)\nend\n\nfunction joint1_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta1 set to \'..newVal)\n    sim.setJointTargetPosition(joint1, newVal*deg)\nend\n\nfunction joint2_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta2 set to \'..newVal)\n    sim.setJointTargetPosition(joint2, newVal*deg)\nend\n\nfunction joint3_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta3 set to \'..newVal)\n    sim.setJointTargetPosition(joint3, newVal*deg)\nend\n\nfunction joint16_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta16 set to \'..newVal)\n    sim.setJointTargetPosition(joint16, newVal*deg)\n    sim.setJointTargetPosition(joint20, -newVal*deg)\nend\n\nfunction sysCall_init()\n    -- do some initialization here\n    joint1 = sim.getObjectHandle(\'motor1\')\n    joint2 = sim.getObjectHandle(\'motor2\')\n    joint3 = sim.getObjectHandle(\'motor3\')\n    joint16 = sim.getObjectHandle(\'motor16\')\n    joint20 = sim.getObjectHandle(\'motor20\')\n    i = 0\n    deg = math.pi/180\n    print(i)\n    xml = [[\n<ui closeable="true" on-close="closeEventHandler" resizable="true">\n    <label text="This is a demo of the CustomUI plugin. Browse through the tabs below to explore all the widgets that can be created with the plugin." wordwrap="true" />\n    <tabs>\n        <tab title="Numeric">a\n            <label text="Sliders can be oriented horizontally or vertically, and have optional properties that can be set (in the XML) such as minimum and maximum value." wordwrap="true" />\n            <label text="" id="3000" wordwrap="true" />\n            <label text="theta1" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="360" on-change="joint1_rotate" />\n            <label text="theta2" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="65" on-change="joint2_rotate" />\n            <label text="theta3" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="185" on-change="joint3_rotate" />\n            <label text="theta16" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="15" on-change="joint16_rotate" />\n        </tab>\n    </tabs>\n</ui>\n]]\n    ui=simUI.create(xml)\n    \nend \n \n (From:  2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf ) \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'Solidworks繪圖', 'text': 'Solidworks\xa0 緣起說明與介紹 \n SolidWorks是熱門的CAD軟體之一 ：截至2011年第一季度，全球約有150多萬工程師，設計師和約15萬家公司是SolidWorks的用戶。 \n 建模方法 \n 參數可以是數值參數，如線路長度或直徑圓圈，或幾何參數，如切線，平行，同心，水平或垂直等數字參數可以與對方的關係，通過使用，這使得他們捕捉設計意圖。 \n 在SolidWorks中建立一個模型通常始於一個2D草圖。該草圖由幾何，如點，線，弧，圓錐曲線和公式。尺寸添加到素描來定義的大小和位置的幾何形狀。關係是用來定義屬性，如切、平行、垂直、同心圓。 \n \n', 'tags': '', 'url': 'Solidworks繪圖.html'}, {'title': 'Solidworks 安裝配置', 'text': 'Solidworks\xa0套件下載安裝與配置\xa0 SW2017 Professional 安裝光碟下載 \n Solidworks  下載安裝與配置流程影片:  https://www.youtube.com/watch?v=mATc13CAB4w \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017 \n 由於安裝配置 Solidworks 時必須使用 nfu 的 vpn, 因此各學員必須按照 說明 , 完成本學期的 vpn 使用申請. \n Solidworks 分別提供 2017 與 2020 版本: \n SW2017 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n SW2020 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n NX12 版本: \n NX12 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n NX12 可攜版本下載 \xa0(必須先登入 @gm 帳號後才能下載) \n Inventor: \n 請在校園網路, 使用 nfu vpn 或設定系上代理主機, 就可以從  https://2019wcm.blogspot.com/2019/07/autodesk-inventor-professional.html  嘗試下載 autodesk.iso 後安裝 Inventor Professional 版本. \n Onshape: \n 至  https://www.onshape.com/en/  申請帳號後使用. \n Solvespace: \n 至  https://solvespace.com  下載或從  https://github.com/solvespace/solvespace  下載原始碼, 以可攜程式系統自行編譯後使用. \n', 'tags': '', 'url': 'Solidworks 安裝配置.html'}, {'title': 'Solidworks 操作流程', 'text': 'Solidworks 零組件繪圖操作流程影片 (Youtube)  https://www.youtube.com/watch?v=y1DmcIe5Y6M \n Solidworks  零組件繪圖教學影片 (Wink) \n \n', 'tags': '', 'url': 'Solidworks 操作流程.html'}, {'title': 'Onshape繪圖', 'text': 'Onshape 緣起說明與介紹 \n Onshape是一套線上3D繪圖軟體，先在平面繪製外型，再將外型擠出至希望的大小，如需要將物件切割再將它去除即可。 \n Onshape 版面初步介紹 \n 點選建立進到繪圖地區 \n \n 點選草圖 \n \n *(畫平面圖時要在參考平面上畫) \n 選擇平面 Top上視 / Front前視 / Right側視 \n 依照要畫的零件方向來選擇平面繪製 \n \n', 'tags': '', 'url': 'Onshape繪圖.html'}, {'title': 'Onshape 安裝配置', 'text': 'Onshape:至 \xa0 https://www.onshape.com/en/ \xa0 申請帳號後使用. \n Onshape註冊過程:  https://www.youtube.com/watch?v=7xBGX4umRA8 \n', 'tags': '', 'url': 'Onshape 安裝配置.html'}, {'title': 'Onshape 操作流程', 'text': 'Onshape 零組件繪圖操作流程影片 (Youtube)  https://www.youtube.com/watch?v=Cga5oO5MzPk \n Onshape  零組件繪圖教學影片 (Wink) \n', 'tags': '', 'url': 'Onshape 操作流程.html'}, {'title': '運動場景', 'text': 'Solidworks: \n Solidworks\xa0零件轉出後轉入 CoppeliaSim 操作影片 (Youtube):  https://www.youtube.com/watch?v=D0AIV365rR4 \n Solidworks  零件轉入 CoppeliaSim 教學影片 (Wink) \n Onshape: \n CAD2 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube):  https://www.youtube.com/watch?v=l1DtU7kPYiU \n CAD2 零件轉入 CoppeliaSim 教學影片 (Wink) \n', 'tags': '', 'url': '運動場景.html'}, {'title': 'W13', 'text': '零組件繪圖進度 Onshape \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n   \n ------------------------------------------------------------------------------------- \n 零組件繪圖進度 SolidWorks \n \n \n \n \n \n \n   \n \n \n \n \n \n ------------------------------------------------------------------------------------- \n 一軸模擬 \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n ------------------------------------------------------------------------------------- \n 二，三軸模擬 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'w10', 'text': 'W10 之後, 繼續執行 HW1, HW1-1, HW2 與 Final Project. \n 從 cad2021 課程內容中可知電腦輔助設計實習的課程目的: \n 鼓勵每一位同學都能及早 確定努力的目標 , 證明自己具備 獨立研究與解題能力 . \n HW1 牽涉利用 SolidWorks, Inventor, NX, Onshape 與 Solvespace 等五套不同的 MCAD (Mechanical Computer Aided Design) 3D 參數繪圖套件完成 meArm 四軸機械手臂零組件繪製與組立. \n 學英文兼學 SolidWorks, 下載 \xa0 Mastering SolidWorks \xa0 (在學校網路或設定代理主機下載) ( 參考 ) \n Space modeling with SolidWorks and NX \xa0 (在學校網路或設定代理主機下載) (NX \xa0 參考 ) \n Learn AutoDesk Inventor 2018 Basics \xa0(在學校網路或設定代理主機下載) ( 參考 ) \n Onshape 1-1 ~ 12-3 \xa0 ( 參考 ) \n Solvespace Learning Guide \xa0 ( 參考 ) \n CoppeliaSim (之前為 V-rep) 參考 \n 亦即在 HW1 ~ HW2 以及 Final Project 各分組必須依序完成: \n \n 以上述五種套件的 meArm 機械手臂 零件繪製圖 Wink 影片 與 組立流程 Wink 影片 製作, 並將各 零組件下載連結 整理在各負責學員與 分組作業網站 中 (cad2021ag1 ~ cad2021ag8, cad2021bg1 ~ cad2021bg9, 在各組所分配到的 Fossil SCM server 中呈現. 主機 IPv6 address: 甲班, 2021::af1 ~ 2021::af8, 乙班, 2021::bf1 ~ 2021:: bf9, 將分別設為 cad2021ag1 dot cycu dot org ~ cad2021bg9 dot cycu dot org). \n 各分組學員必須將使用上述不同套件所繪製的零組件 轉入 Coppeliasim 場景 中, 並製作 \xa0 Wink 流程說明影片 . \n 各分組學員必須將各套件轉入之 meArm 場景中的各 主動軸設定流程 Wink 影片 , 放入負責製作學員與分組作業網站中. \n HW1-1 的 \xa0 Mirobot 六軸機械手臂 的 CoppeliaSim 場景 \n HW2 針對 meArm 場景, 進行 Lua 與 Python API 的 逆向運動學控制 . \n 在 meArm 逆向運動學控制場景中, 加入 \xa0 Suction pad \xa0 吸盤的應用. \n 各分組與學員完成 \xa0 Final Project . \n \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w11', 'text': '將各班抽點所讀取的名單由 Gist ( 2a , \xa0 2b ) 轉至 \xa0 studlist \xa0 倉儲. 學號與 Github 帳號將透過: \n 2a: \xa0 https://mde.tw/studlist/2021fall/2a.txt \n 2b: \xa0 https://mde.tw/studlist/2021fall/2b.txt \n 擷取. 各學員若 Github 帳號異動, 可以透過對 \xa0 https://github.com/mdecourse/studlist \xa0 倉儲內容修改後, 以 Pull Requests 要求管理者接收該次改版. \n 亦即之後的抽點將會取用最新且正確的學員 Github 帳號. \n 隨機從 2a 學員名單中 取出 10 個網站 進行查核 ( 2a repo and www list ) \n 隨機從 2b 學員名單中 取出 10 個網站 進行查核 ( 2b repo and www list ) \n', 'tags': '', 'url': 'w11.html'}, {'title': 'H2', 'text': '請檢查作業網站中 \xa0 W11 \xa0 週的抽點名單是否正確. 若否請透過 \xa0 https://github.com/mdecourse/studlist \xa0 倉儲中的 Pull Requests 機制要求訂正. \n 請各學員自選一組 平面四連桿尺寸 , 分別使用個人所分配的兩套 CAD 進行零件繪圖, 完成組立後請轉入 CoppeliaSim 製作運動模擬場景. \n 驗收交付內容: \n \n 各 零件尺寸圖 與 \xa0 3D 零件檔案 , 請放入各學員的倉儲中並在 W11 標題 H2 頁面中 提供下載 . \n 請將兩套 CAD \xa0 繪圖過程製作成一份 Wink 影片 檔案, 並放入 W11 標題 H2 頁面中.. \n 請將組立件轉入 CoppeliaSim, 並製作運動 模擬場景的過程, 製作成一份 Wink 影片 檔案, 並放入個人網頁中的 W11 標題 H2 頁面中. \n \n ----------------------------------------------------------- \n sw四軸連桿 \n 零件檔 \n 40mm \n 100mm \n 120mm \n 140mm \n 繪圖過程 \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ----------------------------------------------------------- \n ons四軸連桿 \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'H2.html'}, {'title': 'w12', 'text': 'Fossil SCM \n 請問從電腦輔助設計實習的角度看 \xa0 https://www.fossil-scm.org/schimpf-book/doc/2ndEdition/fossilbook.pdf , 可以如何使用 Fossil SCM? \n 根據 \xa0 https://mde.tw/cad2021/content/Compile%20Fossil.html \xa0 可以在 Ubuntu 與 Windows 環境中編譯 Fossil SCM, 因此若能夠了解 Fossil SCM 與 TCL scripting 之間的關聯, 或許可以將分散式版次管理納入電腦輔助設計流程中. \n', 'tags': '', 'url': 'w12.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': '1.以相同尺寸完成連趕機構 \n 題目: \n \n ---------------------------------- \n 零件圖 \n \n \n \n \n \n \n \n \n \n \n ---------------------------------- \n 連桿繪製過程及組合 \n YouTube: \n \n Wink: \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ---------------------------------- \n 連桿機構CoppeliaSim運轉 \n YouTube: \n \n \n Wink: \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ---------------------------------- \n 2.以相同尺寸完成對稱之連桿機構 \n 零件圖 \n \n \n \n \n \n \n \n \n \n \n ---------------------------------- \n 對稱連桿繪製過程及組合 \n YouTube: \n \n Wink: \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ---------------------------------- \n 對稱連桿機構CoppeliaSim運轉 \n YouTube: \n \n Wink: \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Final Project.html'}, {'title': 'run', 'text': '\n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'run.html'}, {'title': 'NOTE', 'text': '1.開近端 \n \n 2.複製網址進入更改網頁 \n 3.更改後儲存並且按generate_pages \n 4.推網頁 \n \n \n \n', 'tags': '', 'url': 'NOTE.html'}, {'title': '期末考試', 'text': '第一階段 \n 期末考試(第一階段繪圖、組裝與模擬) \n GDrive： \n \n -------------------------------------------------------------------- \n 第二階段 \n 期末考試(第二階段繪圖、組裝與模擬) \n GDrive：  https://drive.google.com/file/d/1GAf6ZaQFyofUaIg-YiaumWUM9tybxj13/view?usp=sharing \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n -------------------------------------------------------------------- \n 第三階段 \n 期末考試(第三階段繪圖、組裝與模擬) \n GDrive：  https://drive.google.com/file/d/10vYPqgLJNNloDUnqma3RGQR8pg98Hty-/view?usp=sharing \n \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': '期末考試.html'}]};